import React from 'react'
import Header from '../Components/Header'
import { useSelector } from "react-redux";


const Orders = () => {
    const orders = useSelector((state) => state.orders.orders);

  return (
    <>
      <Header />
      orders
    </>
  )
}

export default Orders
